import React from 'react';
import  {
	Container,
	Row,
	ListGroup,
	ListGroupItem
} from 'react-bootstrap';

const Results = () => (
	<Container>
		<h2>Results List </h2>
		<Row>
		<ListGroup>
		  <ListGroupItem href="#" active>Link 1</ListGroupItem>
		  <ListGroupItem href="#">Link 2</ListGroupItem>
		  <ListGroupItem href="#" disabled>Link 3</ListGroupItem>
		</ListGroup>
		</Row>
	</Container>

);

export default Results;
